import { React, Component } from "react";
import TodoItem from "./TodoItem";

class All extends Component {
  render() {
      const { todoItems, onClick, onDoubleClick, onChange, onBlur, onDelete } =
        this.props;
    return (
      <div>
        {todoItems.map((item, index) => (
          <TodoItem
            key={index}
            item={item}
            onClick={onClick}
            onDoubleClick={onDoubleClick}
            onChange={onChange}
            onBlur={onBlur}
            onDelete={this.onDelete(item)}
          />
        ))}
      </div>
    );
  }
}

export default All;
